import React from 'react';

function Footer() {
    return (
    <div class="end">
        <ul class="footerlist">
            <li class="footer">GitHub</li>
            <li>LinkedIn</li>
            <li>Stack Overflow</li>
            <li>Dev.to</li>
        </ul>
    </div>
    );
  }
  
  export default Footer;
